// src/components/HeroSection.js
import React from "react";
import './HeroSection.css';  // Your styles for hero section

const HeroSection = () => {
  return (
    <div className="hero">
      <div className="hero-content">
        <h1>Your Dream Wedding, Perfectly Planned</h1>
        <p>Let us make your special day unforgettable with our expert planning services.</p>
        <a href="/services" className="cta-btn">Explore Services</a>
      </div>
    </div>
  );
};

export default HeroSection;
